import React, { useState } from "react";
import ReactDOM from "react-dom";
// import "./index.css";

const App =()=>{


   return(<>

         <h1 style={{color:white}}>hello</h1>
         <input type="text" /><br/>
         <button>click me</button>
   </>

   )
}
ReactDOM.render(
   <>
  <App />
   </>
 ,document.getElementById("root"));
